  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0156185 includes physical,
  profile and underway data collected aboard the Sikuliaq during cruise SKQ201512S
  in the Arctic Ocean, Beaufort Sea and Bering Sea from 2015-09-27 to 2015-11-10.
  These data include CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT
  SPEED - NORTH/SOUTH COMPONENT (V), SALINITY and WATER TEMPERATURE. The instruments
  used to collect these data include ADCP, CTD and GPS. These data were collected
  by James Thomson of University of Washington; Applied Physics Laboratory, and by
  University of Alaska - Fairbanks as part of Sea State and Boundary Layer Physics
  of the Emerging Arctic Ocean. The Lamont-Doherty Earth Observatory (LDEO) submitted
  these data to NCEI as part of the NSF sponsored Rolling Deck to Repository (R2R)
  program.nnThe ADCP data represent the raw and automated processed data set. Post
  processed quality assessed data are not available in this accession.\",\n\t\"owner_org\":
